      id: '1',
      title: 'Estudar Front-End',
      completed: false,
    },
    {
      id: '2',
      title: 'Arrumar a Casa',
      completed: true,
    }
  ]);

  return (
    <>
      <div className='container'>
        <Tasks />
      </div>
    </>
  );
};

export default App
